def five_div_seq(n: int):
    num_list = []
    for i in range(n - 1, 0, -1):
        if i % 9 == 0 or i % 14 == 0:
            num_list.append(i)
        if len(num_list) >= 3 and num_list[-1] - num_list[-2] == num_list[-2] - num_list[-3]:
            break
    count = 1
    for num in num_list:
        count += str(num).count('5')
    return count

